import React from "react";

export default function myTickets () {

    return(
        <section>
            <h3>My Tickets</h3>
            <section className="tickets">
                <ul>
                    <td>Tour Name</td>
                    
                    <td>Payment Method</td>
                    <td>Price</td>
                    <td>Status</td>
                </ul>
            </section>
        </section>
    )
}
